package variablesanddatatyps;

public class ArithmaticOperation {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		
		//operator
		System.out.println(a+b);
		
		//operator
		System.out.println(b-a);
		
		//multiplication
		System.out.println(a*b);
		
		//division
		
		System.out.println(b/a);
		
		// %
		System.out.println(a%b);
		
		
	}

}
